ONCE UPON AY TIME IN MUMBAI DOBAARA! narrates  
the story of an underworld don, Shoaib . His   
only confidantes are his best friend Javed and 
former lover Mumtaz . He notices Aslam and     
takes him under his wings. Gradually, Aslam    
becomes one of his trusted confidantes.Shoaib  
stumbles upon an aspiring actress Jasmine .    
Slowly, but surely, his attraction towards     
Jasmine goes on to becoming an obsession.      
This creates a rift between Shoaib and Aslam   
and results in the ultimate face-off between   
the mentor and protege.                        



